/* 1. Find the average rating for each genre, considering only movies with a rating above the 
overall average rating. */

overallRating = _.meanBy(moviesData, 'rating')
_.chain(moviesData).filter((moviedata) => moviedata.rating >= overallRating).groupBy('genre').mapValues((genredata) => _.meanBy(genredata, 'rating')).value()

/* 2. Create an array of movie titles released in the 21st century that have a duration within 
30 minutes of the average duration of all movies. */

avgForAllMovies = _.meanBy(moviesData, 'duration')

const twentyFirstCentury = _.filter(moviesData, (movie) => {
   const year = _.toInteger(_.last(_.split(movie.release_date, '/'))) 
   return year >= 2000 && year < 2100 && (movie.duration - avgForAllMovies) <= 30
})

movie_titles = _.map(twentyFirstCentury, (moviedata) => moviedata.title)

//3. Find the director with the highest average rating for their movies.

_.chain(moviesData).groupBy('director').mapValues((director_data,key) => ({'director': key, 'avg': _.meanBy(director_data, 'rating')})).orderBy(['avg'], ['desc']).head().get('director').value()

// 4. Group movies by both genre and decade, counting the number of movies in each group.

groupedDataByDecade = _.chain(moviesData).groupBy('genre').mapValues(genre_data => _.groupBy(genre_data, (genre) => _.multiply(_.round(_.toInteger(_.last(_.split(genre.release_date, '/'))) / 10),10))).value()

moviesCount = _.mapValues(groupedDataByDecade, (decade_data) => _.mapValues(decade_data, (decade) => _.size(decade)))

/* 5. Calculate the total duration of movies for each year and find the year with the highest 
total duration. */

_.chain(moviesData).groupBy((moviedata) => _.toInteger(_.last(_.split(moviedata.release_date, '/')))).mapValues((year_data,key) => ({'year': key, 'total_duration': _.sumBy(year_data, 'duration')})).orderBy(['total_duration'], ['desc']).head().get('year').value()

/* 6. Create a new array of movies with an additional property "isPopular" set to true for movies 
with a rating above 7 and a duration below 150 minutes. */

const popular = _.map(moviesData, (movie) => ({'isPopular': movie.rating > 7 && movie.duration < 150 ? true : false }))
const updatedData = _.merge(moviesData,popular)

_.map(moviesData, movie => ({...movie, isPopular: movie.rating > 7 && movie.duration < 150 ? true : false }))

/* 7. Sort movies by the number of reviews in descending order. If two movies have the same 
number of reviews, sort them by release date in ascending order. */

const sortedMovies = _.orderBy( moviesData,
  ['rating', (movie_data) => _.toInteger(_.last(_.split(movie_data.release_date, '/'))) ],
  ['desc', 'asc']
);

// 8. Find the genre with the highest average rating for movies released in the 20th century.

const twentyCentury = _.filter(moviesData, (movie) => {
   const year = _.toInteger(_.last(_.split(movie.release_date, '/'))) 
   return year >= 1900 && year < 2000 
})

_.chain(twentyCentury).groupBy('genre').mapValues((genre_data,key) => ({ 'genre': key, 'avg_rating': _.meanBy(genre_data, 'rating')})).orderBy(['avg_rating'], ['desc']).head().get('genre').value()

/* 9. Calculate the average duration for each director, considering only directors with 
at least 3 movies. */

_.chain(moviesData).groupBy('director').map((director_data) => ({'avg_duration': _.meanBy(director_data,'duration'), 'movies_count': _.size(director_data)})).filter((movies_data) => movies_data.movies_count > 3).value()

/* 10. Create an array of movies with a "tag" property, where the tag is a combination of the 
first letter of the genre and the last letter of the director's name. */

tag = _.chain(moviesData).map((movie_data) => ({'tag': _.head(movie_data.genre) + _.last(movie_data.director)})).value()
res = _.merge(moviesData,tag)

_.map(moviesData,m => ({...m,tag: _.head(m.genre) + _.last(m.director)}))
